//  Country lookup using offline quadtree generated by Yggdrasil.
//
//  This tool can be used to determine the country name at a given
//  WGS84 coordinate. Lookup is based on quadtree data stored in the remainder
//  of this file. This data can be compressed to under 20 KB, while providing
//  lookup accuracy under 40 km.
//
//  License: BSD
//  Author:  Leonard van Driel, 2013

#import <Foundation/Foundation.h>


@interface YGLookup : NSObject

- (id)initWithString:(NSString *)string;
- (NSString *)labelAt:(NSPoint)point;

@end


@implementation YGLookup {
    NSArray *_root;
}

- (id)initWithString:(NSString *)string
{
    self = [super init];
    if (self) {
        _root = [self.class treeWithString:string];
    }
    return self;
}

- (NSString *)labelAt:(NSPoint)point
{
    return [self.class labelAt:point node:_root rect:NSMakeRect(-180, -180, 360, 360)];
}

+ (NSArray *)treeWithString:(NSString *)string
{
    if (![string hasPrefix:@"YGG:txt:"]) return nil;
    NSUInteger a = 8;
    NSUInteger b = [string rangeOfString:@"," options:0 range:NSMakeRange(a, string.length - a)].location + 1;
    NSUInteger c = [string rangeOfString:@"," options:0 range:NSMakeRange(b, string.length - b)].location + 1;
    NSUInteger length = [[string substringWithRange:NSMakeRange(b, c - b - 1)] integerValue];
    NSArray *labels = [[string substringWithRange:NSMakeRange(c, length)] componentsSeparatedByString:@","];
    NSUInteger index = c + length - 1;
    NSString *last = nil;
    id result = [self nodeWithString:string index:&index labels:labels last:&last];
    return result;
}

+ (id)nodeWithString:(NSString *)string index:(NSUInteger *)index labels:(NSArray *)labels last:(NSString **)last
{
    switch ([string characterAtIndex:++*index]) {
        case '[': {
            id result = @[[self nodeWithString:string index:index labels:labels last:last],[self nodeWithString:string index:index labels:labels last:last],[self nodeWithString:string index:index labels:labels last:last],[self nodeWithString:string index:index labels:labels last:last]];
            (*index)++;
            return result;
        }
        case ',': case ']': return @"";
        case '0': (*index)++; return *last;
        default: {
            NSRange r = [string rangeOfCharacterFromSet:[NSCharacterSet characterSetWithCharactersInString:@",]"] options:0 range:NSMakeRange(*index, string.length - *index)], range = NSMakeRange(*index, r.location - *index);
            NSUInteger i = [[string substringWithRange:range] integerValue];
            (*index) += range.length;
            id result = labels[i - 1];
            *last = result;
            return result;
        }
    }
}

+ (NSString *)labelAt:(NSPoint)point node:(id)node rect:(NSRect)rect
{
    if (!node || [node isKindOfClass:NSString.class]) return node;
    NSUInteger index = 0;
    rect.size.width /= 2;
    rect.size.height /= 2;
    if (point.x >= rect.origin.x + rect.size.width) {
        index += 1;
        rect.origin.x += rect.size.width;
    }
    if (point.y >= rect.origin.y + rect.size.height) {
        index += 2;
        rect.origin.y += rect.size.height;
    }
    return [self labelAt:point node:node[index] rect:rect];
}

@end


static NSString * const ygg;


int main(int argc, const char * argv[])
{
    @autoreleasepool {
        YGLookup *lookup = [[YGLookup alloc] initWithString:ygg];
        if (argc == 3) {
            NSPoint point = NSMakePoint(atof(argv[2]), atof(argv[1]));
            NSString *label = [lookup labelAt:point];
            NSLog(@"Country at %.1f %c %.1f %c is %@", point.y, point.y >= 0 ? 'N' : 'S', point.x, point.x >= 0 ? 'E' : 'W', label.length ? label : @"none");
        } else {
            NSLog(@"usage: lookup latitude longitude");
            NSLog(@"example output:");
            NSLog(@"Country at 52N 5E is %@", [lookup labelAt:NSMakePoint(5, 52)]);
            NSLog(@"Country at 48N 122W is %@", [lookup labelAt:NSMakePoint(-122, 48)]);
        }
    }
    return 0;
}


